<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="utf-8">
    <title>Filter Repeat</title>
</head>
<body>

<script>

    const a = {}
    const b = {}
    const test = [1, 1, "1", "1", "a", "a", {}, {}, {a: 1}, a, a, b, [], [], [1], undefined, undefined, null, null, NaN, NaN];


    const unique = function (array) {
        return [...new Set(array)];
    }

    console.log(unique(test));

</script>
</body>
</html>
